import "./navbar.css";
import {Link, useNavigate} from "react-router-dom";
import { signOut } from "firebase/auth";
import { auth } from "../../firebase";



function NavBar() {
    const navigate = useNavigate();
    const user = auth.currentUser;

    const logoutUser = async(e) => {
        e.preventDefault();

        await signOut(auth);
        navigate('')
    }

